import React, { Component } from 'react'

export default class TabsMust extends Component {
    render() {
        return (
            <ul className="TabsMust">
                <li className="goods">
                    <img className="pic" src="https://img.yzcdn.cn/upload_files/2017/11/22/FrX2ClJ8SXmM0EQpSVfwBWE8UuIp.jpg!middle.jpg"/>
                </li>
            </ul>
        )
    }
}
